import AtlasModal, { ModalTransition } from '@atlaskit/modal-dialog'; // Atlaskit Modal
import styles from 'styles/components/Modal.module.css'; // Component styles

// Modal dialog
export default function Modal({ children, heading = 'heading', open = true }) {
  return (
    <ModalTransition>
      {open && (
        <AtlasModal actions={[{ text: 'Save' }, { text: 'Cancel' }]} heading={heading}>
          AtlasModal
        </AtlasModal>
      )}
    </ModalTransition>
  );
}
